import './App.css';
import React from "react"
import Todoitem from "./components/TodoItem"
import todosData from "./components/todosData"

function App() {
  const todoItems=todosData.map(item => <Todoitem key={item.id} product={item}/>)
  return (
    <div className="todo-list">
      {todoItems}
    </div>
  )  
}

export default App;
